import React from 'react';
import { List, Grid, Segment, Container, Header, Icon, Button, Divider } from 'semantic-ui-react'

const Footer = () => {

    return (
        <Segment vertical style={{ padding: '1em', backgroundColor:'transparent' }}>
            <Divider/>
            <Segment placeholder style={{backgroundColor:'transparent' }}>
                <Segment.Inline>
                    <Button primary>Clear Query</Button>
                    <Button>Add Document</Button>
                </Segment.Inline>
            </Segment>
        </Segment>
    )
}

export default Footer;
